        case 5:
            ulCrc = pulCRCTable[*pb++ ^ (unsigned char)ulCrc] ^ (ulCrc >> 8);

        case 4:
            ulCrc ^= LittleLong(*(CRC32_t *)pb);
            ulCrc = pulCRCTable[(unsigned char)ulCrc] ^ (ulCrc >> 8);
            ulCrc = pulCRCTable[(unsigned char)ulCrc] ^ (ulCrc >> 8);
            ulCrc = pulCRCTable[(unsigned char)ulCrc] ^ (ulCrc >> 8);
            ulCrc = pulCRCTable[(unsigned char)ulCrc] ^ (ulCrc >> 8);
            *pulCRC = ulCrc;
            return;

        case 3:
            ulCrc = pulCRCTable[*pb++ ^ (unsigned char)ulCrc] ^ (ulCrc >> 8);

        case 2:
            ulCrc = pulCRCTable[*pb++ ^ (unsigned char)ulCrc] ^ (ulCrc >> 8);

        case 1:
            ulCrc = pulCRCTable[*pb ^ (unsigned char)ulCrc] ^ (ulCrc >> 8);

        case 0:
            *pulCRC = ulCrc;
            return;
